import React, { useState } from "react"
import "./contact.scss"
import { LinkedIn, GitHub, Mail, Phone, Instagram, Preview } from "@material-ui/icons"

export default function Contact() {

    const [message, setMessage] = useState(false);

    const handleSubmit = (e)=> {
        e.preventDefault();
        setMessage(true)
    }
    return (
        <div className="contact" id="contact">
            <div className="left">
                <img src="assets/shake.svg" alt="" />
            </div>
            <div className="right">
                <h2>Contact.</h2>
                <div>
                    <h1>(316) 518-8543</h1>
                    <Phone className="icon" />

                </div>
            </div>
        </div>
    )
}
